import React, { Component } from 'react';

class NotFound extends Component {
  render(){
  return (
      <div>
            <div className="alert alert-danger" role="alert">
                <strong>Không tìm thấy trang!</strong>
            </div>    
        </div>
  );}
}

export default NotFound;
